int countBattleships(vector<vector<char>>& board) {
    
        int count = 0;
        
        int n = board.size();
        int m = board[0].size();
        
        for(int i=0; i<n; i++) {
            for(int j=0; j<m; j++) {
            
                if(board[i][j] == 'X') {
                   dfs(i, j, n, m, board);
                   count++;
                }
            }
        }
        
        return count;
    }

